const Order_Options = ({ car }) => {
  return (
    <section className="p-5 text-center">
      <h2 className="title-lg">{car.model}</h2>
      <p className="para">Estimated Delivery: {car.order.estimated}</p>
      <div>
        <i className="fa-solid fa-circle-info text-blue-500" />p
      </div>
    </section>
  );
};

export default Order_Options;
